import React from "react";
import Form from 'react-bootstrap/Form';
import "./style.css";

const BookingForm = () => {
  return (
    <div className="bookingForm">
<Form>
  <Form.Row>
    <Col>
      <Form.Control placeholder="First name" />
    </Col>
    <Col>
      <Form.Control placeholder="Last name" />
    </Col>
  </Form.Row>
</Form>
</div>)
}

export default BookingForm;
